import {Dialog as DialogUI, DialogTitle, DialogContent, Input as InputUI} from "@material-ui/core"
import styled from "styled-components"

const Dialog = ({open, onClose, title})  => {
    return <DialogUI fullWidth open={open} onClose={onClose}>
        <DialogTitle ><Title>{title}</Title></DialogTitle>
        <DialogContent><Input></Input></DialogContent>
    </DialogUI>
}

export default Dialog;

const Title = styled.h2`
    display: flex;
    justify-content: center;
    align-items: center;
    margin-top: 0;
`

const Input = styled(InputUI)`
    width: 100%;
    color: "secondary";
`
